  SIGNAL count_from_1                     : unsigned(8 DOWNTO 0);  -- ufix9
  SIGNAL FrameCounter_out1                : unsigned(8 DOWNTO 0);  -- ufix9
  SIGNAL count_1                          : unsigned(8 DOWNTO 0);  -- ufix9
  SIGNAL need_to_wrap_1                   : std_logic;
  SIGNAL count_value_1                    : unsigned(8 DOWNTO 0);  -- ufix9
  SIGNAL count_2                          : unsigned(8 DOWNTO 0);  -- ufix9
  SIGNAL Compare_To_Constant1_out1        : std_logic;
  SIGNAL Logical_Operator_out1            : std_logic;
  SIGNAL Delay4_out1                      : std_logic;
  SIGNAL Upsample_zero                    : std_logic;
  SIGNAL Upsample_muxout                  : std_logic;
  SIGNAL Upsample_bypass_reg              : std_logic;  -- ufix1
  SIGNAL Upsample_bypassout               : std_logic;
  SIGNAL Delay5_out1                      : std_logic;
  SIGNAL Delay6_out1                      : std_logic;

BEGIN
  -- Start pulse offset, in samples @ 1.92 Msps

  u_LTE_MIB_H_ip_src_CIC_Interpolation1 : LTE_MIB_H_ip_src_CIC_Interpolation1
    PORT MAP( clk => clk,
              enb_1_1_1 => enb_1_1_1,
              reset_x => reset_x,
              LTE_MIB_H_ip_src_CIC_Interpolation1_in_re => Delay3_out1_re_1,  -- sfix16_En15
              LTE_MIB_H_ip_src_CIC_Interpolation1_in_im => Delay3_out1_im_1,  -- sfix16_En15
              LTE_MIB_H_ip_src_CIC_Interpolation1_out_re => CIC_Interpolation1_out1_re,  -- sfix26_En15
              LTE_MIB_H_ip_src_CIC_Interpolation1_out_im => CIC_Interpolation1_out1_im  -- sfix26_En15
              );

  -- Count limited, Unsigned Counter
  --  initial value   = 0
  --  step value      = 1
  --  count to value  = 19199
  count_step <= to_unsigned(16#0001#, 15);

  count_from <= to_unsigned(16#0000#, 15);

  count <= SampleCounter_out1 + count_step;

  
  need_to_wrap <= '1' WHEN SampleCounter_out1 = to_unsigned(16#4AFF#, 15) ELSE
      '0';

  
  count_value <= count WHEN need_to_wrap = '0' ELSE
      count_from;

  SampleCounter_process : PROCESS (clk)
  BEGIN
    IF clk'EVENT AND clk = '1' THEN
      IF reset_x = '1' THEN
        SampleCounter_out1 <= to_unsigned(16#0000#, 15);
      ELSIF enb_1_32_0 = '1' THEN
        SampleCounter_out1 <= count_value;
      END IF;
    END IF;
  END PROCESS SampleCounter_process;


  
  alpha1_D_Lookup_Table1_k <= to_unsigned(16#0000#, 15) WHEN SampleCounter_out1 = to_unsigned(16#0000#, 15) ELSE
      to_unsigned(16#7FFF#, 15) WHEN SampleCounter_out1 = to_unsigned(16#7FFF#, 15) ELSE
      SampleCounter_out1;
  alpha1_D_Lookup_Table1_out1_re <= alpha1_D_Lookup_Table1_table_data_re(to_integer(alpha1_D_Lookup_Table1_k));
  alpha1_D_Lookup_Table1_out1_im <= alpha1_D_Lookup_Table1_table_data_im(to_integer(alpha1_D_Lookup_Table1_k));

  PipelineRegister_process : PROCESS (clk)
  BEGIN
    IF clk'EVENT AND clk = '1' THEN
      IF enb_1_32_0 = '1' THEN
        alpha1_D_Lookup_Table1_out1_re_1 <= alpha1_D_Lookup_Table1_out1_re;
        alpha1_D_Lookup_Table1_out1_im_1 <= alpha1_D_Lookup_Table1_out1_im;
      END IF;
    END IF;
  END PROCESS PipelineRegister_process;


  Delay3_process : PROCESS (clk)
  BEGIN
    IF clk'EVENT AND clk = '1' THEN
      IF reset_x = '1' THEN
        Delay3_out1_re <= to_signed(16#0000#, 16);
        Delay3_out1_im <= to_signed(16#0000#, 16);
      ELSIF enb_1_32_0 = '1' THEN
        Delay3_out1_re <= alpha1_D_Lookup_Table1_out1_re_1;
        Delay3_out1_im <= alpha1_D_Lookup_Table1_out1_im_1;
      END IF;
    END IF;
  END PROCESS Delay3_process;


  Delay3_out1_re_1 <= std_logic_vector(Delay3_out1_re);

  Delay3_out1_im_1 <= std_logic_vector(Delay3_out1_im);

  CIC_Interpolation1_out1_re_signed <= signed(CIC_Interpolation1_out1_re);

  CIC_Interpolation1_out1_im_signed <= signed(CIC_Interpolation1_out1_im);

  Delay1_process : PROCESS (clk)
  BEGIN
    IF clk'EVENT AND clk = '1' THEN
      IF reset_x = '1' THEN
        Delay1_out1_re <= to_signed(16#0000000#, 26);
        Delay1_out1_im <= to_signed(16#0000000#, 26);
      ELSIF enb = '1' THEN
        Delay1_out1_re <= CIC_Interpolation1_out1_re_signed;
        Delay1_out1_im <= CIC_Interpolation1_out1_im_signed;
      END IF;
    END IF;
  END PROCESS Delay1_process;


  Shift_Arithmetic_out1_re <= SHIFT_RIGHT(Delay1_out1_re, 10);
  Shift_Arithmetic_out1_im <= SHIFT_RIGHT(Delay1_out1_im, 10);

  Data_Type_Conversion2_out1_re <= Shift_Arithmetic_out1_re(15 DOWNTO 0);
  Data_Type_Conversion2_out1_im <= Shift_Arithmetic_out1_im(15 DOWNTO 0);

  Delay2_process : PROCESS (clk)
  BEGIN
    IF clk'EVENT AND clk = '1' THEN
      IF reset_x = '1' THEN
        Delay2_out1_re <= to_signed(16#0000#, 16);
        Delay2_out1_im <= to_signed(16#0000#, 16);
      ELSIF enb = '1' THEN
        Delay2_out1_re <= Data_Type_Conversion2_out1_re;
        Delay2_out1_im <= Data_Type_Conversion2_out1_im;
      END IF;
    END IF;
  END PROCESS Delay2_process;


  dataOut_re <= std_logic_vector(Delay2_out1_re);

  dataOut_im <= std_logic_vector(Delay2_out1_im);

  
  Compare_To_Constant_out1 <= '1' WHEN SampleCounter_out1 = to_unsigned(16#0080#, 15) ELSE
      '0';

  -- Count limited, Unsigned Counter
  --  initial value   = 0
  --  step value      = 1
  --  count to value  = 399
  count_step_1 <= to_unsigned(16#001#, 9);

  count_from_1 <= to_unsigned(16#000#, 9);

  count_1 <= FrameCounter_out1 + count_step_1;

  
  need_to_wrap_1 <= '1' WHEN FrameCounter_out1 = to_unsigned(16#18F#, 9) ELSE
      '0';

  
  count_value_1 <= count_1 WHEN need_to_wrap_1 = '0' ELSE
      count_from_1;

  
  count_2 <= FrameCounter_out1 WHEN Compare_To_Constant_out1 = '0' ELSE
      count_value_1;

  FrameCounter_process : PROCESS (clk)
  BEGIN
    IF clk'EVENT AND clk = '1' THEN
      IF reset_x = '1' THEN
        FrameCounter_out1 <= to_unsigned(16#000#, 9);
      ELSIF enb_1_32_0 = '1' THEN
        FrameCounter_out1 <= count_2;
      END IF;
    END IF;
  END PROCESS FrameCounter_process;


  
  Compare_To_Constant1_out1 <= '1' WHEN FrameCounter_out1 = to_unsigned(16#000#, 9) ELSE
      '0';

  Logical_Operator_out1 <= Compare_To_Constant_out1 AND Compare_To_Constant1_out1;

  Delay4_process : PROCESS (clk)
  BEGIN
    IF clk'EVENT AND clk = '1' THEN
      IF reset_x = '1' THEN
        Delay4_out1 <= '0';
      ELSIF enb_1_32_0 = '1' THEN
        Delay4_out1 <= Logical_Operator_out1;
      END IF;
    END IF;
  END PROCESS Delay4_process;


  -- Upsample: Upsample by 32, Sample offset 0 
  Upsample_zero <= '0';

  
  Upsample_muxout <= Delay4_out1 WHEN enb_1_32_1 = '1' ELSE
      Upsample_zero;

  -- Upsample bypass register
  Upsample_bypass_process : PROCESS (clk)
  BEGIN
    IF clk'EVENT AND clk = '1' THEN
      IF reset_x = '1' THEN
        Upsample_bypass_reg <= '0';
      ELSIF enb_1_1_1 = '1' THEN
        Upsample_bypass_reg <= Upsample_muxout;
      END IF;
    END IF;
  END PROCESS Upsample_bypass_process;

  
  Upsample_bypassout <= Upsample_muxout WHEN enb_1_1_1 = '1' ELSE
      Upsample_bypass_reg;

  Delay5_process : PROCESS (clk)
  BEGIN
    IF clk'EVENT AND clk = '1' THEN
      IF reset_x = '1' THEN
        Delay5_out1 <= '0';
      ELSIF enb = '1' THEN
        Delay5_out1 <= Upsample_bypassout;
      END IF;
    END IF;
  END PROCESS Delay5_process;


  Delay6_process : PROCESS (clk)
  BEGIN
    IF clk'EVENT AND clk = '1' THEN
      IF reset_x = '1' THEN
        Delay6_out1 <= '0';
      ELSIF enb = '1' THEN
        Delay6_out1 <= Delay5_out1;
      END IF;
    END IF;
  END PROCESS Delay6_process;


  startOut <= Delay6_out1;

END rtl;

